"""
请求数据解析
"""
import binascii

from protobuf_inspector.types import StandardParser

s = ""

with open("my-proto", "wb") as w:
    w.write(binascii.unhexlify(s))

parser = StandardParser()
with open("my-proto", "rb") as fh:
    output = parser.parse_message(fh, "message")
print(output)
